import { ErrorMessage, Field, Form, Formik } from 'formik';
import React, { useEffect, useState } from 'react';
import { Link } from "react-router-dom";
import { getUser } from '../../Utils/Common';
import { useLocation } from 'react-router-dom';
import '../../Utils/Constants';
import ModalGen from '../../Utils/Modals/ModalGeneric';
import GenericApi from '../../Api/Services/GenericApi';
import Spinner from '../../Utils/Spinner';
import { useParams } from "react-router";

function ActuacionesMigracionLista() {

    const [getModalState, setModalState] = useState({ title: "", message: "", show: false });
    const [getListaActuaciones, setListaActuaciones] = useState({ data: [], links: [], meta: [] });

    let { radicado, vigencia} = useParams();


    useEffect(() => {
        async function fetchData() {
            window.showSpinner(true);
            listaActuaciones();
            
           
        }
        fetchData();
    }, []);


    const listaActuaciones= () => {
        try {

            //buscamos el parametro
            GenericApi.getGeneric("migracion-lista-actuaciones/"+radicado+"/"+vigencia).then(
                datos => {

                    if (!datos.error) {
                        setListaActuaciones(datos);

                    } else {
                        //setModalState({ title: "Migración Datos del interesado", message: datos.error.toString(), show: true, redirect: '/AntecedentesForm', alert: global.Constants.TIPO_ALERTA.ERROR });
                    }
                    window.showSpinner(false);
                }
            )
        } catch (error) {
            // console.log(error);
        }
    }


    const lista = () => {

        if (getListaActuaciones.data != null && typeof (getListaActuaciones.data) != 'undefined') {
            return (

                getListaActuaciones.data.map((item, i) => {
                    return (
                        <tr>
                            <td>{i=i+1}</td>
                            <td>{item.attributes.version}</td>
                            <td>{item.attributes.nombre}</td>
                            <td>{item.attributes.tipo}</td>
                            <td>{item.attributes.autoNumero}</td>
                            <td>{item.attributes.fecha}</td>
                            <td>{item.attributes.fechaTermino}</td>
                            <td><Link className="text-dark" to={`/CargarMigracionActuacion/${radicado}/${vigencia}/${item.attributes.id}`}>
                                <button type="button" className="btn btn-sm btn-secundary w2d_btn-large mr-1 mb-3 text-left">
                                    <i className={colorFase(item.attributes.semaforizacion)}></i> Completar información
                                </button></Link>
                            </td>
                        </tr>
                    )
                })
            )
        }
    }


    return (
        <>
            {<Spinner />}   
            {<ModalGen data={getModalState} />}
          
            <div className="w2d_block">
                <nav aria-label="breadcrumb">
                    <ol className="breadcrumb breadcrumb-alt push">
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Buscador`}><small>Buscador</small></Link></li>
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`}><small>Inicio proceso de migración</small></Link></li>
                        <li class="breadcrumb-item"> <small>Lista de actuaciones</small></li>
                    </ol>
                </nav>
            </div>

            <div className="block block-themed">
                <div className="block-header">
                    <h3 className="block-title">Proceso disciplinario :: {radicado} - {vigencia}</h3>
                </div>

                <div className="block-content">
                    
                    <div className="col-md-12">

                        <table class="table">
                            <thead>
                                <tr>
                                    <th scope="col">#</th>
                                    <th scope="col">Versión</th>
                                    <th scope="col">Nombre</th>
                                    <th scope="col">Tipo</th>
                                    <th scope="col">Número de auto</th>
                                    <th scope="col">Fecha</th>
                                    <th scope="col">Fecha de término</th>
                                    <th scope="col">Acciones</th>
                                </tr>
                            </thead>
                            <tbody>
                                   {lista()}                 
                            </tbody>
                        </table>
                        
                    </div>
                </div>
                
            </div>

                   
        </>
    );
}


export default ActuacionesMigracionLista;
